import React from 'react';
import { VideoData } from '../lib/supabase';

interface VideoSidebarProps {
  isOpen: boolean;
  onClose: () => void;
  videos: VideoData[];
  onVideoSelect: (video: VideoData) => void;
}

const VideoSidebar: React.FC<VideoSidebarProps> = ({ 
  isOpen, 
  onClose, 
  videos,
  onVideoSelect
}) => {
  const getVideoThumbnail = (url: string) => {
    try {
      if (url.includes('youtube.com') || url.includes('youtu.be')) {
        const videoId = url.includes('youtube.com')
          ? url.split('embed/')[1]?.split('?')[0]
          : url.split('youtu.be/')[1]?.split('?')[0];
        return `https://img.youtube.com/vi/${videoId}/mqdefault.jpg`;
      }
      return null;
    } catch {
      return null;
    }
  };

  if (!isOpen) return null;

  return (
    <>
      {/* Overlay */}
      <div
        className={`fixed inset-0 bg-black/50 backdrop-blur-sm transition-opacity duration-300 z-[100]
          ${isOpen ? 'opacity-100' : 'opacity-0 pointer-events-none'}`}
        onClick={onClose}
      />

      {/* Sidebar */}
      <div
        className={`fixed right-0 top-0 h-screen w-[320px] bg-[#1e1e1e] shadow-2xl flex flex-col z-[101]
          ${isOpen ? 'animate-slideInRight' : 'animate-slideOutRight'}`}
      >
        {/* Header fixo */}
        <div className="bg-[#1e1e1e] border-b border-[#404040]">
          <div className="px-6 py-5 flex justify-between items-center">
            <h3 className="text-xl font-semibold text-[#e1aa1e]">Últimos Vídeos</h3>
            <button
              onClick={onClose}
              className="p-2 hover:bg-[#404040] rounded-full transition-colors text-gray-400 hover:text-[#e1aa1e]"
            >
              <svg
                className="w-6 h-6"
                fill="none"
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth="2"
                viewBox="0 0 24 24"
                stroke="currentColor"
              >
                <path d="M6 18L18 6M6 6l12 12"></path>
              </svg>
            </button>
          </div>
        </div>

        {/* Lista com scroll */}
        <div className="flex-1 overflow-y-auto custom-scrollbar">
          <div className="px-4 py-3 space-y-4">
            {videos.map((video) => {
              const thumbnail = getVideoThumbnail(video.url);
              return (
                <div key={video.id} className="space-y-2">
                  {/* Título do vídeo */}
                  <h4 className="text-sm font-medium text-[#e1aa1e] px-2">
                    {video.title || 'Vídeo sem título'}
                  </h4>

                  {/* Container do vídeo */}
                  <div
                    className="flex gap-2 p-2 hover:bg-[#2d2d2d] cursor-pointer rounded-lg group transition-colors"
                    onClick={() => {
                      onVideoSelect(video);
                      onClose();
                    }}
                  >
                    {thumbnail ? (
                      <div className="relative w-full aspect-video rounded overflow-hidden border border-[#404040] group-hover:border-[#e1aa1e]/50 transition-colors">
                        <img
                          src={thumbnail}
                          alt={video.title || 'Thumbnail do vídeo'}
                          className="w-full h-full object-cover transform group-hover:scale-105 transition-transform duration-300"
                        />
                        <div className="absolute inset-0 bg-black/40 opacity-0 group-hover:opacity-100 transition-opacity flex items-center justify-center">
                          <svg
                            className="w-12 h-12 text-[#e1aa1e]"
                            fill="none"
                            stroke="currentColor"
                            viewBox="0 0 24 24"
                          >
                            <path
                              strokeLinecap="round"
                              strokeLinejoin="round"
                              strokeWidth={2}
                              d="M14.752 11.168l-3.197-2.132A1 1 0 0010 9.87v4.263a1 1 0 001.555.832l3.197-2.132a1 1 0 000-1.664z"
                            />
                          </svg>
                        </div>
                      </div>
                    ) : (
                      <div className="w-full aspect-video bg-[#2d2d2d] rounded border border-[#404040] flex items-center justify-center">
                        <svg
                          className="w-12 h-12 text-gray-400 group-hover:text-[#e1aa1e] transition-colors"
                          fill="none"
                          stroke="currentColor"
                          viewBox="0 0 24 24"
                        >
                          <path
                            strokeLinecap="round"
                            strokeLinejoin="round"
                            strokeWidth={2}
                            d="M14.752 11.168l-3.197-2.132A1 1 0 0010 9.87v4.263a1 1 0 001.555.832l3.197-2.132a1 1 0 000-1.664z"
                          />
                        </svg>
                      </div>
                    )}
                  </div>
                </div>
              );
            })}
          </div>
        </div>
      </div>
    </>
  );
};

export default VideoSidebar;
